import React from 'react';
import { useAuth } from '../context/AuthContext';

export default function Dashboard() {
  const { user } = useAuth();

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold">Welcome to Pet Clinic</h1>
      <p className="mt-4">Logged in as: <strong>{user?.role}</strong></p>
    </div>
  );
}
